import React from "react";
import ReactDOM from "react-dom";
// import ram, { car, myName } from "./App.jsx";
import * as ice from "./App.jsx";

ReactDOM.render(
  <>
    <ol>
      <li>ANR</li>
      <li>{ice.ram}</li>
      <li>{ice.car}</li>
      <li>{ice.myName()}</li>
    </ol>
  </>,
  document.getElementById("root")
);
